using BOMBEROSCR.F5.ENT;
using System;
using System.Collections.Generic;
using System.Configuration;
using System.IO;
using System.Linq;
using System.Net;
using System.Net.Mail;
using System.Net.Mime;
using System.Text;
using System.Threading.Tasks;
using System.Web.Script.Serialization;
using static BOMBEROSCR.F5.UTL.Constantes;

namespace BOMBEROSCR.F5.UTL
{
  public class NotificacionesCorreo
  {
    public RespuestaGenerica<Notificacion> EnviarCorreo(Notificacion modelo, string htmlBody, UsuarioAutenticado pInfoUsuario)
    {
      var resultado = new RespuestaGenerica<Notificacion>();

      try
      {
        string mailBodyhtml = htmlBody;
        var msg = new MailMessage();
        msg.From = new MailAddress(ConfigurationManager.AppSettings["cuentaCorreo"]);
        msg.Subject = modelo.Asunto;
        msg.Body = mailBodyhtml;

        var emails = modelo.Destinatarios.Trim().Split(';');
        foreach(var email in emails) { 
            if(!string.IsNullOrEmpty(email.Trim()))
                msg.To.Add(email.Trim());
        }

        msg.IsBodyHtml = true;



        if (!string.IsNullOrEmpty(modelo.Adjuntos))
        { 
          var listaAdjuntos = modelo.Adjuntos.Split('|');

          if (listaAdjuntos != null && listaAdjuntos.Count() >= 1)
          {
            foreach (var item in listaAdjuntos)
            {
              if (!string.IsNullOrEmpty(item))
              {
                try
                {
                  msg.Attachments.Add(new Attachment(item));
                }
                catch (Exception ex)
                {
                  resultado.DescripcionRespuesta = "Correo no enviado " + ex.Message;
                  resultado.CodigoRespuesta = Codigos.ErrorNoControlado;
                  //new UTL.Bitacora().InsertarBitacoraF5(new BitacoraF5
                  //{
                  //  Proyecto = "BOMBEROSCR.F5.UTL",
                  //  Clase = "NotificacionesCorreo",
                  //  Metodo = "EnviarCorreo - Agregar adjunto",
                  //  Usuario = pInfoUsuario.Usuario,
                  //  IP = pInfoUsuario.IP,
                  //  ParamentrosEntrada = new JavaScriptSerializer().Serialize(item),
                  //  ParamentrosSalida = resultado.DescripcionRespuesta,
                  //  Mensaje = ex.Message,
                  //  DetalleError = ex.StackTrace
                  //});
                }
              }
            }
          }
        }
        var smtpClient = new SmtpClient(ConfigurationManager.AppSettings["host"], Convert.ToInt32(ConfigurationManager.AppSettings["Puerto"]));
        //Para pruebas: smtpClient.UseDefaultCredentials = True
        //Para desarrollo: smtpClient.UseDefaultCredentials = False
        smtpClient.UseDefaultCredentials = Convert.ToBoolean(ConfigurationManager.AppSettings["UseDefaultCredentials"]);
        if (!Convert.ToBoolean(ConfigurationManager.AppSettings["UseDefaultCredentials"]))
        {
          var password = Seguridad.Decriptar(ConfigurationManager.AppSettings["passCuentaCorreo"]);
          smtpClient.Credentials = new NetworkCredential(ConfigurationManager.AppSettings["cuentaCorreo"], password);
        }
        //Para pruebas: smtpClient.EnableSsl = False
        //Para desarrollo: smtpClient.EnableSsl = True
        smtpClient.EnableSsl = Convert.ToBoolean(ConfigurationManager.AppSettings["EnableSsl"]);
                

        //Agrega Imagen del logo
        var imageData = Convert.FromBase64String("");
        var res = new LinkedResource(new MemoryStream(imageData), "image/png");
        res.TransferEncoding = TransferEncoding.Base64;
        res.ContentId = "logoNotificaciones";
        AlternateView alternateView = AlternateView.CreateAlternateViewFromString(htmlBody, null, MediaTypeNames.Text.Html);
        alternateView.LinkedResources.Add(res);
        msg.AlternateViews.Add(alternateView);
        //Fin Agrega Imagen del logo
        

        smtpClient.Send(msg);

        resultado.CodigoRespuesta = Codigos.Exito;
        resultado.DescripcionRespuesta = "El correo se envió satisfactoriamente";
      }
      catch (System.Exception ex)
      {
        resultado.DescripcionRespuesta = "Correo no enviado " + ex.Message;
        resultado.CodigoRespuesta = Codigos.ErrorNoControlado;

        //new UTL.Bitacora().InsertarBitacoraF5(new BitacoraF5
        //{
        //  Proyecto = "BOMBEROSCR.F5.UTL",
        //  Clase = "NotificacionesCorreo",
        //  Metodo = "EnviarCorreo",
        //  Usuario = pInfoUsuario.Usuario,
        //  IP = pInfoUsuario.IP,
        //  ParamentrosEntrada = new JavaScriptSerializer().Serialize(modelo),
        //  ParamentrosSalida = resultado.DescripcionRespuesta,
        //  Mensaje = ex.Message,
        //  DetalleError = ex.StackTrace
        //});
      }
      return resultado;
    }
  }
}
